import React, { useContext } from 'react'
import { dataContext } from '../Context/DataContext'
import { Container } from 'react-bootstrap'

function Products() {
    const { data } = useContext(dataContext)
    return (
        <div>
            {data.map((product) => (
                <div key={product.id}> {/* Agrega una clave única para cada elemento */}
                    <img src={product.photo} className='w-50' />
                    <h1>{product.title}</h1> {/* Puedes mostrar el título del producto aquí */}
                </div>
            ))}
        </div>
    )
}

export default Products
